import React from "react";
import {XYPlot, XAxis, YAxis, VerticalBarSeries, LabelSeries} from 'react-vis';
class MyLinegraph extends React.Component {
render() {
  const data = this.props.data;
  const chartDomain = [0,400];
    return (
      <div>
         <XYPlot 
      xType="ordinal" 
      yDomain={chartDomain}>
      <XAxis />
      <YAxis />
      <VerticalBarSeries
          data={data}
      />
      <LabelSeries
          data={data.map(obj => {
              return { ...obj, label: obj.y.toString() }
          })}
          labelAnchorX="middle"
          labelAnchorY="text-after-edge"
      />
  </XYPlot>
      </div>
    );
  }
}

export default MyLinegraph;
